import React, { Component, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Form from './component/Form';

// (`http://www.omdbapi.com/?apikey=e5004a7b&s=${movieName}`);

function App() {

  const [state, setState] = useState({
    s: '',
    results: [],
    selected: {}
  });
  const apiurl = "http://www.omdbapi.com/?apikey=e5004a7b";
  const HandleInput = (e) => {
    let s = s.target.value;
    setState(prevState => {
      return { ...prevState, s: s }
    })
  }





  return (
    <div className="App" >
      <header className="App-header">
        <h1 className="App-title">Movies Application</h1>
      </header>
      <Form HandleInput={this.HandleInput} />

    </div>
  );

}

export default App;
